package com.ms.may231el.main;

public class Doge {
	private int price;
	private  String name;
	public Doge() {
		// TODO Auto-generated constructor stub
	}
	public Doge(int price, String name) {
		super();
		this.price = price;
		this.name = name;
	}
	public int getPrice() {
		return price;
	}
	public void setPrice(int price) {
		this.price = price;
	}
	public String getName() {
		return name;
	}
	public void setName(String name) {
		this.name = name;
	}
	
}